広告文責/販売会社:株式会社Hanbit TEL:050-1040-7307<br><br><br><br><font color="#BF0000"><b>■関連商品</b></font><hr color="#BF0000"><br><b>本商品のサイズ、色違い、関連商品はこちら</b><br><br><br><font color="#BF0000"><b>■商品内容</b></font><hr color="#BF0000"><br>モダン・コンシャス<br>Itarian Modern Design Dining Set<br>イタリアモダン デザインダイニングセット【Vermut】ヴェルムト<br>Black & White の誘惑<br>01 Modern Design<br>際立つコントラスト<br>02 Design Table<br>魅了する漆黒<br>03 Design Chair<br>モダニズムの機能美<br> <br>―――――<br>ブラックとホワイトのコントラストが際立つ美しさ。<br>メタリックな輝きと漆黒の艶が添えられ<br>洗練されたラグジュアリー空間へといざないます。<br>ホワイト比率を高く、すっきりとしたモダンに。<br>空間全体をシャープにするブラックインテリア。<br><br>―――――<br>艶やかなブラック鏡面に、クールなホワイトガラスがアクセントのデザイン。<br>白と黒の影がリフレクトし、モードな空間を演出します。<br>横顔のデザインもクール。スタイリッシュな個性が光ります。<br>5mm厚の高品質強化ガラス(飛散防止フィルム加工済)を使用。<br>角は面取りし、滑り止めの樹脂も付属していて安心です。<br>鏡面仕上げには、高級家具に用いられる「UV塗装」を採用。<br>光沢度が高く、耐熱性、耐摩耗性ともに高品質の仕上がりです。<br><br>―――――<br>継承される合理性と機能性<br>無駄をそぎ落としたモダニズムのデザイン美。<br>カンチレバー構造の、シンプルかつ実用性に優れた<br>クールなデザインは、今もなお愛され続けています。<br>スマートな容姿は、ダイニングだけでなく<br>ミーティングチェアとしても機能する優秀さ。<br>スチールパイプのしっかりした構造は<br>無駄にバウンドせず、しっかりホールドしてくれます。<br>脚部裏面には床を守る樹脂製の保護パーツつき。<br>上質で肌触りの良いソフトレザー。<br>汚れに強く、お手入れが簡単です。<br>広い座面と背もたれはクッション性も良く<br>長時間の利用でも疲れにくい座り心地です。<br><br><br><br><font color="#BF0000"><b>■商品スペック</b></font><hr color="#BF0000"><br>◆テーブル<br>【サイズ】(約)幅150×奥行80×高さ72cm<br>【材質】<br>  天板=パーチクルボードフラッシュ板、MDF、5mm強化ガラス<br>  フレーム=ラバーウッド材<br>【製品重量】約42kg<br>【梱包数】3<br>【梱包サイズ】<br>(3-1)約153×86×9cm<br>(3-2)約121×10×8cm<br>(3-3)約53×75×11cm<br>【生産国】ベトナムまたは中国<br>※組立品<br>◆チェア(2脚組)<br>【サイズ】(約)幅47×奥行53×高さ80(座面高46)cm<br>【材質】<br>張地=ウレタン<br>フレーム=スチール、合板<br>【製品重量】約8kg(1脚当たり)<br>【梱包数】1(2脚1梱包)<br>【梱包サイズ】約94×68×50cm<br>【生産国】中国<br>※完成品<br><br>◆5点セット<br> セット内容:テーブル×1、チェア×4<br>梱包数:<br>(5-1)テーブル天板<br>(5-2)テーブル幕板<br>(5-3)テーブル脚<br>(5-4)チェア<br>(5-5)チェア<br>◆7点セット<br> セット内容:テーブル×1、チェア×6<br>梱包数:6<br>(6-1)テーブル天板<br>(6-2)テーブル幕板<br>(6-3)テーブル脚<br>(6-4)チェア<br>(6-5)チェア<br>(6-6)チェア<br><br>※サイズ、重量は概算です。<br>※実際の商品の色にできるだけ近づけるよう撮影を行っておりますが、商品色はご使用のモニターによって実際の明るさや色と多少異なって見える場合がございます。<br>※こちらの商品は天然木を使用した商品の為、一点一点木目が異なります。<br>※仕様は予告なく変更になる場合がございます。予めご了承下さい。<br> <br><br><br><br><br><font color="#BF0000"><b>■送料・配送についての注意事項</b></font><hr color="#BF0000"><br>●本商品の出荷目安は<b>【即日 - 1営業日　※土日・祝除く】</b>となります。<br><br>●お取り寄せ商品のため、稀にご注文入れ違い等により欠品・遅延となる場合がございます。<br><br>●本商品は同梱区分<b>【TS3】</b>です。同梱区分が<b>【TS3】</b>と記載されていない他商品と同時に購入された場合、梱包や配送が分かれます。<br><br>●沖縄、離島および一部地域への配送時に追加送料がかかる場合がございます。<br><br>●大型商品のため、複数購入時は追加送料がかかる場合がございます。<style type="text/css">
